import './ExpenseItem.css';

function Bid(props) {
    fetch("https://jsonplaceholder.typicode.com/users")
  // Converting received data to JSON
  .then((response) => response.json())
  .then((json) => {

  // 2. Create a variable to store HTML table headers
    let li = `<tr><th>Bid Amount</th><th>Name</th><th>Email</th><th>Email</th> <th>Phone</th></tr>`;

    // 3. Loop through each data and add a table row
    props.forEach(() => {
      li += `<tr>
        <td>${amount}</td>
        <td>${firstName} </td>
        <td>${email}</td>
        <td>${phone}</td>
      </tr>`;
    });

    // 4. DOM Display result
    document.getElementById("users").innerHTML = li;
  });
    return (
        <div>
            <table>
                <thead>
                    <td>Bid Amount</td>
                    <td>Name</td>
                    <td>Email</td>
                    <td>Mobile</td>
                </thead>
                <tr>
                    <td>${props.amount}</td>
                    <td>{props.firstName}</td>
                    <td>{props.email}</td>
                    <td>{props.phone}</td>
                </tr>
            </table>
        </div>
    );
}

export default Bid;
